    "       text = element_text(size = 20),\n",
    "       plot.title = element_text(hjust = 0.5))+\n",
    "  labs(y=\"Industries Using Spark\", x =\"Sector\", title = \"Usage of Spark\") +\n",
    "  geom_bar()"
   ]
